Red Oktober 2022 was a lot of fun this year. 
Can’t wait to get out there again 🔥

I had the full @cryeofficial set up 
JPC 2.0 with @highspeedgear belt and mag pouches 
The womens G3 multi cam pants and field shirt 
@teamwendy1 helmet and @3mpeltor ears / swivel mounts 
@wilcoxindustries mount for NVG 

Using my KR 103 (762 x39) from @kalashnikovusa 
@paonlineofficial 503gi ACSS reticle 
@zenitcoru Sport rail and dust cover (has pic mount which makes mounting an optic easy… ) 
And drilled out the bottom of the Handguard (blasphemy I know…) to fit an Mlok piece so I could attach my Bi pod.. 

Competing makes me really happy I wish I could compete every single day I would be exhausted but it would be worth it… I’m so thankful for all the friends I have met the past couple of years on the road and all over the world ♥️

#kalashgirl #30cal #kusa #aklife #happy 😁

