⭐️⚡️level up⚡️⭐️

In order for you the be the best you have to eat sleep and breathe it!

I am working hard with the @livefireapp dry firing and train as much as I can on the range while I am taking a break from competing. I’m getting bigger so it’s not as easy to be as quick as I would like to be out there, but breaking down the fundamentals and working on accuracy and shaving time off of my draws and presentation is a good way to keep in practice. 

I put together this new belt yesterday for my @jessejamesfirearms 1911! 

Find all the details below:
@blueforcegear CHLK Molle belt system 
@blueforcegear holster adapter 
@blueforcegear Mag NOW! Double mag pouch 
@safarilandgroup 1911 578-GLS pro fit lefty holster 
@safarilandgroup GLS quick attachment male and female adapter kit 

Use code “JAMES10” to save 10% on your order @blueforcegear ⚡️

I’m loving the lightweight of the belt and holster combo it definitely helps having something so modular, light, and adjustable as I am getting bigger. Less is more 😜😆🫣

This stage at last years @dragonscupuspsa flowed so nicely. I was really proud of my footwork and got an awesome hitfactor on this stage. Crushed it. I saw everyone’s videos over the weekend and want to congratulate all my friends on doing so awesome!!!!! The match looked like it had the best stages yet! Can’t wait for next year !!!!!⭐️🌞🐉🐲

