This was the best birthday ever!!!!!!!!!
@popeofwelding you out did yourself and I’m so thankful for this amazing surprise I love you so so much! 
Thank you to all the guys at @westcoastchoppers for all of your hard work it means so much to me to have my first car as something you all put your blood sweat and tears into and I will cherish it forever!!!!!! My sweet husband knew exactly what car would be perfect for me and has been working on it for a year now… I’m so blessed to have someone who knows me better than anyone in the world! ♥️♥️♥️♥️

