@canamoffroad commander XT is so bitchin! You guys rock thanks for making it a reality ♥️ we’re going to wear these tires out shooting for @tv_outlaw , muddin, and so much bad a$$ stuff 🫣😬!!!!

Back in the saddle again! 

I’m so glad that I was able to continue dry firing with @livefireapp through the end of my pregnancy so I could keep working on my skill level. 

I had an hour today to enjoy the toys on the range and I shot all the things 💥

I got back out there and ran some practice drills with my Open 🔫, test fired and played around with some @popeofwelding toys! 

I’m telling you that .45 is accurate in the @jessejamesfirearms dominator but I had to choke down on it lol! .45 is so snappy 😆🙏 (watch the slow Mo of me having Ciskeep wrenching on the grip!) 

